  \"progress-report-to-the-iowa-department-of-natural-resources-carbon-sequestration-project\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This is a progress report on carbon sequestration
  studies in progress at Neal Smith National Wildlife Refuge.  The objectives of the
  project are to: estimate carbon sequestration within similar soils under different
  vegetation (annual row crops, restored/reconstructed prairie, remnant prairie, and
  savanna) within the Neal Smith National Wildlife Refuge; determine the effect of
  time since prairie reestablishment on soil carbon accumulation; and assess the effect
  of burning as a prairie management strategy on soil carbon accumulation.\",\n\t\"license_title\":
